import Card from "../UI/Card";
import MealsItem from "./MealsItem";

const MealList = () => {



    return (
      
        <Card>
        <ul>
            {dummy_meals.map(meal => (
                <MealsItem
                
                    key={meal.id}
                    id={meal.id}
                    name={meal.name}
                    description={meal.description}
                    price={meal.price}
                />
            ))}
            </ul>
        </Card>
    );
}

export default MealList;
